import React, { useState, useEffect } from "react";
import axios from "axios";

// Axios Instance
const ai = axios.create({
  baseURL: "http://127.0.0.1:8000/",
});

export default function FeedBack_user(props) {
  const [formData, setFormData] = useState({
    name: "",
    zone: "",
    division: "",
    dept: "",
    message: "",
    date: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      alert(e);
      console.log("Enter handle submit" + formData);
      const response = await ai.post("Feedback/create/", formData);
      console.log("Data added successfully:", response.data);
      // Clear form fields after successful submission
      setFormData({
        name: "",
        zone: "",
        division: "",
        dept: "",
        message: "",
        date: "",
      });
    } catch (error) {
      console.error("Error adding data:", error);
    }
  };

  // const [text, setText] = useState("");

  // for fatch data from backend start
  const [getFeedback, setFeedback] = useState([]);
  // console.log("hi1111111");

  const getAllFeedback = async () => {
    try {
      const Feedbackdata = await ai.get("/Feedback/list/");

      setFeedback(Feedbackdata.data);
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    getAllFeedback();
  }, []);
  console.log(getFeedback);
  // end

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <h6>{props.heading}</h6>
        <div className="mb-3">
          &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
          &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
          &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
          {/* <button type="button" className="btn btn-primary position-relative">
            Total Words
            <span
              className="position-absolute top-0 start-100 translate-middle badge rounded-pill bg-danger"
              align
              right
            >
              <span className="visually-hidden">unread messages</span>
            </span>
          </button> */}
          &nbsp; &nbsp;
          {/* <button type="button" className="btn btn-primary position-relative">
            Total character
            <span className="position-absolute top-0 start-100 translate-middle badge rounded-pill bg-danger">
              {text.length}{" "}
              <span className="visually-hidden">unread messages</span>
            </span>
          </button> */}
          <div>
            <label>Feed back By:</label>
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
            />
          </div>
          <select className="form-select" aria-label="Default select example">
            <option
              selected
              name="zone"
              value={formData.zone}
              onChange={handleChange}
            >
              Please select Zone
            </option>
            <option value="1">WCR</option>
            <option value="2">ECR</option>
            <option value="3">NCR</option>
            <option value="3">NCR</option>
          </select>
          <select className="form-select" aria-label="Default select example">
            <option
              selected
              name="division"
              value={formData.division}
              onChange={handleChange}
            >
              Please select Division
            </option>
            <option value="1">Jabalpur</option>
            <option value="2">Kota</option>
            <option value="3">Bhopal</option>
          </select>
          <div>
            <label>Department:</label>
            <input
              type="text"
              name="dept"
              value={formData.dept}
              onChange={handleChange}
            />
          </div>
          <label htmlFor="mybox" className="form-label" align="left">
            <strong>Please feel free to leave any Feedback here</strong>
          </label>
          <textarea
            type="text"
            name="message"
            value={formData.message}
            onChange={handleChange}
            className="form-control"
            // value={text}
            id="myBox"
            rows="4"
            col="8"
          ></textarea>
        </div>
        <div>
          <label>Date:</label>
          <input
            type="date"
            name="date"
            value={formData.date}
            onChange={handleChange}
          />
        </div>

        <button type="submit">Save Feedback</button>
        <ul>
          <h4>Your Feedbacks</h4>
          {getFeedback.map((item) => (
            <li key={item.id}>
              {item.zone} - {item.division} - {item.message} - {item.date}
            </li>
          ))}
        </ul>
      </form>
    </div>
  );
}
